import React, {Component} from 'react';
import './sidebar.css';
class Sidebar extends Component {
  render(){
    return(
      <div className="Sidebar">
      <ul>
      <li>Home</li>
      <li> About </li>
      <li> Contact </li>
      </ul>
      </div>
    )
  }
}
export default Sidebar;
